import React from 'react'

let a
let b

function add(a, b) {
  let sum = a + b
  return sum
}

function sub(a, b) {
  let sub = a - b
  return sub
}

function div(a, b) {
  let div = a / b
  div = div.toFixed(2) // esa karne se decimal ke baad sirf two digit he dikaayi denge.
  return div
}

function mult(a, b) {
  let mult = a * b
  return mult
}

export { add, sub, div, mult }
